import AssemblyStartTechnical from "../../../models/General/AssemblyStartTechnical";
import Company from "../../../models/Company";
import User from "../../../models/User";
//method to post
export const createAssemblyStartTechnial = async(req, res) => {
    const{
        parameterSetting,
        revisionDate,
        repairMold,
        labelColor,
        ifRepair,
        orderJob,
        resinVerifiedDried,
        numberDryer,
        switchConected,
        comments,
        purgeMachine,
        containerRed,
        alarmsProgramed,
        moldWather,
        temperatures,
        transportBand,
        counterMachine,
        settingRobot,
        formatEmp,
        employee, 
        noCheckValidation,
        status,
        company,       
    } = req.body;
    const newAssemblyStartTechnical = new AssemblyStartTechnical({
        parameterSetting,
        revisionDate,
        repairMold,
        labelColor,
        ifRepair,
        orderJob,
        resinVerifiedDried,
        numberDryer,
        switchConected,
        comments,
        purgeMachine,
        containerRed,
        alarmsProgramed,
        moldWather,
        temperatures,
        transportBand,
        counterMachine,
        settingRobot,
        formatEmp,     
        noCheckValidation,
        status,       
    });
    if(employee){
        const foundEmployees = await User.find({
            username:{$in: employee},
        });
        newAssemblyStartTechnical.employee = foundEmployees.map((employee) => employee._id);
    }
    if(company) {
        const foundCompany = await Company.find({
            _id:{$in: company},
        });
